import { useEffect } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';

function Loading() {
  const navigate = useNavigate();
  const location = useLocation();
  const images = location.state?.images || [];
  const vehicleDetails = location.state?.vehicleDetails || null;

  useEffect(() => {
    if (images.length > 0 || vehicleDetails) {
      navigate('/newloading', { state: location.state });
    } else {
      navigate('/');
    }
  }, [location, navigate, images, vehicleDetails]);

  return null;
}

export default Loading;
